nut/integracoes.html.body:
Integrações
Resumo:
É de responsabilidade do NUT planejar, organizar e providenciar junto aos outros membros da CJR as integrações da empresa. As integrações podem variar bastante a temática, desde momentos de reflexão e dinâmicas de grupo a Noite de Jogos e uma saída pra um barzinho. 
O papel do NUT é estudar os melhores períodos do semestre para as integrações, planejar quais irão ser feitas e elaborar um orçamento aproximado de cada uma para que conste no Planejamento Financeiro do NOE.
Cabe aos membros do NUT decidir qual período é mais adequado aos diferentes tipos de dinâmica e sempre estar pensando em novas e diferentes formas de aproximar mais os membros e trainees.

Integra
O Integra é a primeira integração dos trainees e é caracterizado por conter várias palestras motivacionais, de apresentação da CJR, dinâmicas de grupo e ser seguido de uma festa. Geralmente ocorre um mês após o início do Processo Trainee, mas isso não é uma regra, embora seja recomendado que ocorra no início do PT para motivar os trainees e fazê-los conhecer melhor os membros da empresa. Pode ou não ser imersivo, mas costuma começar cedo (9h~10h da manhã) e ser seguido da festa de noite.
Os membros do NUT são os maiores responsáveis pelo Integra, mas os outros membros costumam ajudar por ser um evento "grande".
Itens importantes para que o evento ocorra bem:

Um lugar agradável, espaçoso e confortável para que todos se sintam bem à vontade (geralmente a casa de alguém);
Comida (café, almoço e lanchinho para a festa);
Bebidas para a festa;
Convidar ex-membros e membros para palestras motivacionais (com uma boa antecedência e continuamente lembrá-los);
Uma casa com espaço para quem for dormir no local.


Festa Trainee:
A Festa Trainee é um evento que ocorre ao fim do Processo Trainee onde os trainees (recém efetivados como membros), devem organizar e providenciar tudo o que será necessário, tal como:

Ingressos (valor arrecadado será utilizado para reembolsar o invesimento, o que sobrar irá para a conta da CJR);
Local (recomenda-se a casa de algum trainee/membro/ex-membro);
Comida;
Bebida (recomenda-se Extrato, a bebida do MEJ, além de outras);
Atrações (opcional);
Música (recomendam-se playlists colaborativas no Spotify).

Para mais detalhes, basta entrar em contato com membros ou ex-membros.

nut/afastamento.html.body:
Política de Afastamento
Resumo:
Os membros da CJR têm direito a solicitar um afastamento com tempo de duração de 4 meses (no máximo), onde não terão que realizar nenhuma tarefa da CJR durante esse período.
Cabe aos membros do NUT receber essas solicitações, comunicar ao Pequeno Conselho para que o pedido seja analisado pelos líderes dos núcleos e manter o controle dos membros afastados, assim como entrar em contato com os mesmos para que estes estejam cientes dos seus prazos de retorno às atividades.
O que é necessário:

Notificar o Pequeno Conselho;
Aprovação do Pequeno Conselho;
Uma planilha para controle dos membros afastados;
Revisar de tempos em tempos quem está afastado e quando voltam;
Entrar em contato notificando o membro da data de retorno (um mês antes e uma semana antes);

nut/processo-trainee.html.body:
Processo Trainee
Resumo:
O Processo Trainee ocorre após todo Processo Seletivo e tem como objetivo fornecer a base do conhecimento necessário para que os trainees consigam realizar projetos, além de integrá-los mais à empresa e de introduzir os núcleos e seus papéis/processos dentro da empresa.
Esse é um dos maiores e mais importantes processos da CJR e cada núcleo tem seu papel para que o Processo Trainee funcione bem e o objetivo de capacitar os trainees seja alcançado.

Responsabilidades dos Núcleos:
NAM: como o PS está diretamente ligado ao PT, podemos dizer que a maior responsabilidade do NAM é a divulgação do PS, mas além disso, também é responsabilidade do núcleo realizar as postagens dos eventos (Integra e Festa Trainee, por exemplo) e informações importantes na página do Facebook (como quem foram os candidatos aprovados no PS que irão compôr o PT). 
NDP: o papel do NDP no PT é de imensa importância, pois cabe ao núcleo providenciar as ferramentas para a capacitação técnica dos trainees, assim como planejar qual conteúdo será ministrado, quem será(ão) o(s) professor(es) e monitor(es), qual será a estrutura das aulas e das avaliações, entre outros.
NOE: o NOE tem como objetivo apresentar o Estatuto e o Regimento Interno aos trainees e a fiscalizar o funcionamento do PT junto ao NUT, entre outros.
NUT: o papel do NUT no PT é de fiscalizar o processo e garantir que tudo esteja dentro do que foi planejado/definido para o processo em vigor. É importante reforçar o papel de fiscal do NUT, pois é o processo mais importante do núcleo junto com o Acompanhamento. Além disso, cabe ao NUT entrar em contato com os trainees e receber feedbacks, sugestões, além de providenciar e planejar soluções para os problemas que os trainees venham a ter durante o processo.

Conteúdo:
O conteúdo pode variar de gestão para gestão, mas como o foco da CJR atualmente está em sites e sistemas web, os conteúdos ministrados no PT são:

Editores de texto (Sublime, Atom, etc);
Sistemas de versionamento (Git);
HTML;
CSS;
JavaScript;
Banco de Dados (SQL e modelagem);
Ruby;
Ruby on Rails;
Algumas Gems do Ruby on Rails (Devise, CanCan, etc);

Entre outros para que os trainees tenham uma base sólida para começarem a realizar projetos assim que terminarem o PT.

Estrutura:
O PT não segue uma estrutura definida, mas é importante observar que o formato em que se teve o maior sucesso até o momento foram 2~3 aulas por semana + 1 dia de monitoria (opcional). Ex: segunda, terça e quinta têm-se aulas de 12:30 às 13:50 e quarta monitoria (marcar horário com o monitor).
Alguns itens importantes que devem ser providenciados:

Estabelecer conteúdo a ser ensinado;
Montar um cronograma do PT;
Selecionar a bibliografia que será utilizada;
Professor(es);
Monitor(es);
Reservar o LINF para as aulas;
Planejar formas de avaliação;
Correção das avaliações e feedback;
Controle de faltas;
Controle das tarefas;
Planejar o Integra;
Planejar Projeto Final;
Correção do Projeto Final e feedback;
Delegar a Festra Trainee aos trainees.


Para mais informações, recomenda-se o uso do Google Drive e do Trello, além de consultar membros mais experientes e ex-membros, pois há muita documentação desse processo e os outros membros saberão explicar como foram os PTs passados.
